import Reach from 'react';
import { Routes, Route, Link } from "react-router-dom";
import pfp from './images/image.jpg';

import ClubsList from './components/clubs-list.component';
import CreateClub from './components/create-club.component';
import CreateUser from './components/create-user.component';
import EditClub from './components/edit-club.component';

import axios from "axios";
import ClubsFeed from './components/clubs-feed';

function App() {

  return (
    <div className='h-screen w-screen flex flex-row'>

    {/*PHOTO + BUTTONS DIV */}
    <div className=' h-screen w-64 flex flex-col justify-start '>

      {/* div for image */}
      <div className='flex align-center justify-center '>

      <img src={pfp} alt='pfp' className='h-full w-full w-36 h-36 border-2 m-3 border-[#D0D1C9]'/>

      </div>

    {/* div for buttons to organize them in flex */}
    <div className='flex flex-col m-5'>

      <button className='bg-[#ffffff] h-10 mx-2 border-2 border-[#D0D1C9] shadow-md'>
      Profile
      </button>
      <button className='bg-[#ffffff] h-10 m-2 border-2 border-[#D0D1C9] shadow-md'>
      Friends
      </button>
      <button className='bg-[#ffffff] h-10 mx-2 border-2 border-[#D0D1C9] shadow-md'>
      Settings
      </button>
      <button className='bg-[#ffffff] h-10 m-2 border-2 border-[#D0D1C9] shadow-md'>
      Logout
      </button>


      </div>

    {/* div for chat button */}

      <button className='my-10 mx-7 rounded-md border-2 border-[#D0D1C9] shadow-md'>
        Chat
      </button>

    </div>

    <nav className='flex justify-around content-between w-screen my-7 border-2 border-[#D0D1C9] shadow-md h-10'>


      <a href="/clubs">
        Clubs List
      </a>
      <a href="/users" >
        Users List
      </a>
      <a href="/clubs/update/:id" >
        Update Club
      </a>
      <a href="/clubs/testClub">
        Update Club
      </a>
    </nav>
    <Routes>
        <Route path="clubs" element={<ClubsList/>} />
        <Route path="/clubs/testClub" element={<ClubsFeed/>} />
    </Routes>



  </div>
  );
}

export default App;
